import React , { Component } from 'react';
//import App from './App';
import { Link } from "react-router-dom";
import { AppBar, Toolbar, Typography } from 'material-ui';

export default props =>
<AppBar position="static">
    <Toolbar>
        <Typography variant ="display4" color="inherit">
        <div className="Header">
                <img className="logo" src="https://icon2.cleanpng.com/20180623/tab/kisspng-franz-kafka-the-zrau-aphorisms-letters-to-milena-franz-reuleaux-5b2ebc0a948a25.2995202215297894506084.jpg" data-atf="0" width="150" height="150"/>           
                <ul className="menu-ul">
                <li><Link to="/">Home</Link></li>
                <li><Link to="/photos">Photos</Link></li>
                <li><Link to="/books">Books</Link></li>
                
            </ul>
        </div>
        </Typography>
    </Toolbar>
    </AppBar>

